import React from 'react'
import { Alert , AlertTitle  } from '@mui/material'

export default function AlertingMsg() {
  return (
    <Alert severity="info">
        <AlertTitle>Info</AlertTitle>
        This is an info Alert with an informative title.
      </Alert>
  )
}
